import {createi, fetchBaseQuery} from '@reduxjs/toolkit/query/react';

const baseQuery = fetchBaseQuery({
    baseUrl:''
});
export const apiSlice = createAPi({
    baseQuery,
    tagTypes:[
        'User'
    ],
    endpoints:(builder) => ({})
});
